    private static Dictionary<string, string>? _htmlNamedEntities;
    public static Dictionary<string, string> HTMLNamedEntities
    {
        get
        {
            if (_htmlNamedEntities == null)
            {
                using var decompressedMS = new MemoryStream(25764);
                var htmlClass = new HTMLEntitiesDeflatedBytesClass();
                using (var compressedMS = new MemoryStream(htmlClass.HTMLEntitiesDeflatedBytes))
                {
                    using var ds = new DeflateStream(compressedMS, CompressionMode.Decompress);
                    ds.CopyTo(decompressedMS);
                    decompressedMS.Position = 0;
                }

                _htmlNamedEntities = new Dictionary<string, string>(2032);

                var keySB = new StringBuilder();
                var valueSB = new StringBuilder();
                StringBuilder currentSB = keySB;
                int b;
                while ((b = decompressedMS.ReadByte()) != -1)
                {
                    switch (b)
                    {
                        case '=':
                            currentSB = valueSB;
                            break;
                        case ',':
                            _htmlNamedEntities.Add(keySB.ToString(), valueSB.ToString());
                            keySB.Clear();
                            valueSB.Clear();
                            currentSB = keySB;
                            break;
                        default:
                            currentSB.Append((char)b);
                            break;
                    }
                }
            }

            return _htmlNamedEntities;
        }
    }

